package com.app.secret.entity;import com.app.secret.core.base.entity.BaseEntity;import io.swagger.annotations.ApiModel;import io.swagger.annotations.ApiModelProperty;import javax.persistence.Column;import javax.persistence.Table;/** * @author kexiaohong */@Table(name = "APP_TAGS")@ApiModel(value = "标签")public class AppTags extends BaseEntity {    @Column(name = "TAG_NAME")    @ApiModelProperty(value = "标签名称")    private java.lang.String tagName;    @Column(name = "TAG_CODE")    @ApiModelProperty(value = "标签编码")    private java.lang.String tagCode;    @Column(name = "TAG_DESC")    @ApiModelProperty(value = "标签描述")    private java.lang.String tagDesc;    public java.lang.String getTagName() {        return this.tagName;    }    public void setTagName(java.lang.String tagName) {        this.tagName = tagName;    }    public java.lang.String getTagCode() {        return this.tagCode;    }    public void setTagCode(java.lang.String tagCode) {        this.tagCode = tagCode;    }    public java.lang.String getTagDesc() {        return this.tagDesc;    }    public void setTagDesc(java.lang.String tagDesc) {        this.tagDesc = tagDesc;    }}